INSERT INTO `threads` VALUES (4,3852,'我也來發文~~','<p><img alt=\"one piece~~\" src=\"data:image/jpeg;base64,\" style=\"height:183px; width:275px\" /></p>\r\n\r\n<p><tt><strong><big>one</big> <em>piece<s> <span dir=\"rtl\">luffy</span></s></em></strong></tt></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<table align=\"left\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"height:92px; width:303px\" summary=\"來囉~~\">\r\n	<caption>嗨嗨嗨</caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>222</td>\r\n			<td>444</td>\r\n			<td>666</td>\r\n			<td>888</td>\r\n		</tr>\r\n		<tr>\r\n			<td>333</td>\r\n			<td>555</td>\r\n			<td>777</td>\r\n			<td>999</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h1><tt><strong><em><s><span dir=\"rtl\">&reg;%&diams;</span></s></em></strong></tt></h1>','e68891e4b99fe4be86e799bce696877e7e','2019-04-09 17:41:01','2019-04-09 17:41:01',NULL),(5,3841,'嗨嗨嗨','<p><strong>測試測試測試</strong></p>','e597a8e597a8e597a8','2019-04-09 18:13:54','2019-04-09 18:13:54',NULL),(7,3852,'吃吃吃 吃吃吃吃吃','<p><iframe allow=\";\" allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/XNn25bpf3P8\" width=\"640\"></iframe></p>\r\n\r\n<p><s><em>吃拔吃拔吃拔</em></s></p>','e59083e59083e59083e59083e59083e59083e59083e59083','2019-04-09 20:53:43','2019-04-09 20:53:43',NULL),(9,3841,'上傳圖片','<p><img alt=\"\" src=\"http://dev-www.uanalyze.com.tw/storage/ckeditor/6X6QAo2Ae2YBiXTXA1SbDGrw42CIi5nJEfrjnYy6.png\" style=\"height:225px; width:225px\" /></p>\r\n\r\n<p>上傳圖片</p>','e4b88ae582b3e59c96e78987','2019-04-10 18:13:41','2019-04-10 18:13:41',NULL),(11,3841,'測試發文','<p><img alt=\"\" src=\"http://dev-www.uanalyze.com.tw/storage/ckeditor/qOtUq2F2GkAjKpPBJx01Ac55Uj4JBufvPqmHAGYg.png\" style=\"height:47px; width:100px\" /></p>\r\n\r\n<p>上傳圖片</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allow=\";\" allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/TcMBFSGVi1c\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>看電影</p>','e6b8ace8a9a6e799bce69687','2019-04-10 18:53:03','2019-04-10 18:53:03',NULL),(12,1,'test for 888','<blockquote>\r\n<p>以下為測試上傳圖片與影片內容。</p>\r\n</blockquote>\r\n\r\n<p>這篇文章要和大家分享什麼是每股盈餘(EPS)，分成以下幾個部分：</p>\r\n\r\n<ol>\r\n	<li>什麼是EPS?</li>\r\n	<li>EPS的計算公式?</li>\r\n	<li>EPS高或低的意義-和本益比的關係?</li>\r\n	<li>EPS去哪裡查?</li>\r\n	<li>使用EPS要注意什麼?</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>什麼是每股盈餘EPS (Earnings Per Share)？</h2>\r\n\r\n<p>它可以快速幫我們了解規模大小不同的公司幫股東賺錢能力的差異，<br />\r\n舉個例子：</p>\r\n\r\n<p>假設市場先生要送你一張股票，以下兩間公司選哪一間比較有利?</p>\r\n\r\n<h3>公司A. 年淨利5000萬元<br />\r\n公司B. 年淨利2000萬元</h3>\r\n\r\n<p>其實如果只從獲利去看其實無法判斷，<br />\r\n必須要考慮到公司股本數不一樣。</p>\r\n\r\n<p>公司A. 年淨利5000萬元，總股數1000萬股 EPS 5元<br />\r\n公司B. 年淨利2000萬元，總股數200萬股 EPS 10元</p>\r\n\r\n<p>這時透過EPS就可以快速看出來，</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://dev-www.uanalyze.com.tw/storage/ckeditor/am4iQW4tzDpgL8BLvAhQfjaWvqJy5canHdoI2jZ2.png\" style=\"width:100%\" /><br />\r\n&nbsp;</p>\r\n\r\n<div class=\"youtube-embed-wrapper\" style=\"position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden\"><iframe allow=\";\" allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/phVMbzJzVKw\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\r\n\r\n<p><img alt=\"\" src=\"http://dev-www.uanalyze.com.tw/storage/ckeditor/CjhnjGxGHa6P5EdSVNsj00h9O2rfjs9RSLKQVNqG.png\" style=\"width:100%\" /></p>','testfor888','2019-04-10 22:29:04','2019-04-10 22:36:43',NULL),(13,3886,'123','<p>123</p>\r\n\r\n<p>123</p>\r\n\r\n<p>lll</p>\r\n\r\n<p>aaa</p>','123','2019-04-10 22:37:41','2019-04-10 22:38:51',NULL),(14,3886,'超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章超長文章','<p>超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文超長內文